  import axios from 'axios';
  import React, { useState } from 'react';
  import { Link, useNavigate } from 'react-router-dom';
  import Swal from 'sweetalert2';


  function Login()
  {
    const [loginemail, setLoginEmail] = useState('');
    const [loginpass, setLoginPass] = useState('');
    const [errorMessage, setErrorMessage] = useState('');
    const navigate = useNavigate();

    const loginrecord = () => {
        axios.post('http://localhost:4000/login', { loginemail, loginpass }).then(
            result => {
                console.log(result);
                if (result.data === 'userdata') {
                    navigate('/userdashboard');
                } else if (result.data === 'exhibitordata') {
                    navigate('/exhibitordashboard');
                } else {
                    // No user found with this email
                    Swal.fire({
                        icon: 'error',
                        title: 'Oops...',
                        text: 'No user found with this email!',
                    });
                }
            },
            error => {
                // Handle errors from the backend
                if (error.response.status === 400) {
                    setErrorMessage(error.response.data.error);
                    if (errorMessage.includes('email')) {
                        // No email entered
                        Swal.fire({
                            icon: 'error',
                            title: 'Oops...',
                            text: 'Please enter your email!',
                        });
                    } else {
                        // Incorrect password
                        Swal.fire({
                            icon: 'error',
                            title: 'Oops...',
                            text: 'Incorrect password!',
                        });
                    }
                }
            }
        );
    };
      return(

          <div>
                    <nav class="navbar main-nav border-less fixed-top navbar-expand-lg p-0">
    <div class="container-fluid p-0">
        {/* logo */}
        <Link class="navbar-brand" to="/">
          <img src="images/logo.png" alt="logo"/>
        </Link>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span class="fa fa-bars"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNav">
        <ul class="navbar-nav mx-auto">
          <li class="nav-item dropdown active dropdown-slide">
            <Link class="nav-link" to="/"  data-toggle="dropdown">Home
            </Link>
          
          </li>
      <li class="nav-item">
        <Link class="nav-link" to="/about">AboutUs</Link>
        </li>
          <li class="nav-item">
            <Link class="nav-link" to="/speaker">Speakers
            
            </Link>
          </li>
        
          <li class="nav-item">
            <Link class="nav-link" to="/schedule">Schedule</Link>
          </li>
          <li class="nav-item">
        <Link class="nav-link" to="/event">Events</Link>
        </li>
          <li class="nav-item">
        <Link class="nav-link" to="/gallery">Gallery
        </Link>
        </li>
        <li class="nav-item">
        <Link class="nav-link" to="/pricing">Pricing
        </Link>
        </li>
        <li class="nav-item">
        <Link class="nav-link" to="/faq">FAQ
        </Link>
        </li>
          <li class="nav-item">
            <Link class="nav-link" to="/contact">Contact</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/feedback">Feedback</Link>
          </li>
      <li class="nav-item">
            <Link class="nav-link" to="/login">Login</Link>
          </li>
        </ul>
        
        </div>
    </div>
  </nav>

  <br/>
  <br/>
  <br/>
  <br/>
              <div class="container mt-5">
                  <h3> Login Form</h3>
                  <input type='email' placeholder='Email' onChange={(e) => setLoginEmail(e.target.value)}
                       className='form-control w-50 mt-3'/>
                <input type='password' placeholder='Password ' onChange={(e) => setLoginPass(e.target.value)}
                       className='form-control w-50 mt-3'/>
                <br></br>
                <button onClick={loginrecord} className='btn btn-main-md orange-btn'>Login Here</button>
                {errorMessage && <p className="text-danger">{errorMessage}</p>}
                <br></br>
              </div>
  <br></br>
              <footer class="footer-main">
      <div class="container">
        <div class="row">
          <div class="col-md-12">
            <div class="block text-center">
              <div class="footer-logo">
                <img src="images/footer-logo.png" alt="logo" class="img-fluid"/>
              </div>
              <ul class="social-links-footer list-inline">
                <li class="list-inline-item">
                  <a href="#"><i class="fa fa-facebook"></i></a>
                </li>
                <li class="list-inline-item">
                  <a href="#"><i class="fa fa-twitter"></i></a>
                </li>
                <li class="list-inline-item">
                  <a href="#"><i class="fa fa-instagram"></i></a>
                </li>
                <li class="list-inline-item">
                  <a href="#"><i class="fa fa-rss"></i></a>
                </li>
                <li class="list-inline-item">
                  <a href="#"><i class="fa fa-vimeo"></i></a>
                </li>
              </ul>
            </div>
            
          </div>
        </div>
      </div>
  </footer>
  {/* Subfooter */}
  <footer class="subfooter">
    <div class="container">
      <div class="row">
